import React from 'react';
import livecasinoimage from '../../assets/livecasiono.jpg'

const LiveCasino = () => {
    return (
        <div>
           <img src={livecasinoimage} alt="" />
           <div>
          <select
            name=""
            id=""
            placeholder=""
            className="shadow-2xl p-2 border border-black w-full outline-none max-w-xl"
          >
            <option value="" disabled selected>
              খেলা অনুসন্ধান করুন
            </option>
            <option value="exchange">exchange</option>
          </select>
        </div>
        </div>
    );
};

export default LiveCasino;
